import React from 'react'

const About = () => {
    return(
        <div className='about'>
            <h1>About.me</h1>
            <br></br>
            <p>I'm a Portuguese Electronics Student at University of Madeira.</p>
            <p>I'm also a Research Assistant at Interactive Technologies Institute of Madeira, where I help developing projects from low to high level.</p>
        </div>
    );
}


export default About;
